var tipuesearch = {"pages": [{'title': 'About', 'text': 'cmsimde_site \n ======= \n 終於，SSH要成功了嗎? 20230316 By 40723217 \n ======= \n 0413，重新測試SSH putty推送 \n', 'tags': '', 'url': 'About.html'}, {'title': 'SSH同步', 'text': '用SSH同步的方法: \n \n 首先須下載putty \n 使用 puttygen.exe製作鑰匙 \n puttygen.exe會根據游標移動軌跡製作獨一無二的鑰匙，製作完後，會得到兩把鑰匙 \n 上面較長的是放在網路上的，也就是要貼到自己github帳號下的SSH鑰匙 \n \n 而另一把則是私人的鑰匙，用來對應github上的這一把，將它存在Y槽(為確保可攜系統到另一個裝置時能確實找到)，格式一定要是.ppk \n \n 開啟putty.exe \n \n HostName(or IP address)這欄打上github.com，因為我們是使用github建立網站的 \n Saved Sessions打上任意英數字串 例:ABC \n \n 左側Connection>SSH>Auth>Credentials，Pirvate key file for authentication這欄找到剛剛存在Y槽的鑰匙，然後回到最上面Save \n 之後按右下的Open就完成了 \n \n 到小組倉儲站 \n \n Code底下copy網址，選使用SSH的 \n 把@後的github.com替換成剛才putty.exe中Saved Sessions打的任意英數 例:ABC \n 進入tmp，git clone 改完的網址，空格後打上將要建立的資料夾名稱 \n 就成功使用SSH，clone小組倉儲的內容到近端了 \n 之後要更改小組站時，只要進到這個新資料夾就能直接打指令了 \n \xa0 \n', 'tags': '', 'url': 'SSH同步.html'}, {'title': '關於git pull', 'text': '當小組有複數的成員要編輯小組站時，會遇到近端和遠端的內容不相符的情況 \n 這時候就需要先將遠端的內容git pull到自己的近端 \n 但是當組員A更新了小組站內容，組員B卻沒有先git pull就直接cms上去更新網站時，就會發生衝突 \n 導致之後都無法進行acp \n \n 目前想到最簡單的方法就是每當有組員更新小組站時，其他組員下次開啟時就先gut pull，並且不要同時更新 \n \n', 'tags': '', 'url': '關於git pull.html'}, {'title': 'bubbleRobTutorial', 'text': '\n', 'tags': '', 'url': 'bubbleRobTutorial.html'}, {'title': 'bubblerob-control', 'text': '\n \n \n \n 製作人員:40723217 林立翔 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa040923241 蔡淳宇 \n \n 報告心得 \n CoppeliaSim可以用於自走車模擬，讓使用者可以在不破壞實物的情況下進行自走車測試，使用CoppeliaSim模擬自走車的好處之一是可以進行快速更新，並立即測試新的功能。在自走車的前端設定了一個偵測前方環境的感應器，可以用於設定當碰到物體時就轉向的功能。而在加入方向鍵輸入的設定後，就能使用方向鍵操控自走車移動，並推動球體。 \n \n \n \n \n', 'tags': '', 'url': 'bubblerob-control.html'}, {'title': '0420-1hr', 'text': '我使用了chatgpt和三個小時的奮戰下，終於讓自己能夠在宿舍也能使用可攜系統進行bubbleRob的鍵盤操作了。 以下是解決的一半過程對話:(Q代指我、A代指chatgpt) \n Q:我在Scite上遇到了"系統找不到指定的檔案。" 但我不清楚是甚麼原因，能列舉可能的原因嗎? \n A:"系統找不到指定的檔案" 是一個錯誤訊息，通常代表了一個檔案或路徑並不存在或無法被找到。以下是可能導致這個錯誤的原因： \n 1.檔案或路徑不存在：這是最常見的原因，檔案或路徑可能已被刪除、移動或更改名稱。 2.權限不足：如果您不擁有足夠的權限來訪問該檔案或路徑，系統就會報告此錯誤。 3.檔案或路徑正在使用中：如果檔案或路徑正在被其他程式使用，例如正在被其他程式打開，您就無法訪問它。 4.磁碟問題：如果您的硬碟遇到了問題，例如壞道或損壞，也可能會導致系統找不到指定的檔案。 5.程式錯誤：有時候程式本身也可能導致這個錯誤，可能是因為程式中存在錯誤或不正確的路徑設置。 \n 建議您檢查檔案路徑是否正確，確認您有足夠的權限來訪問檔案，並關閉其他正在使用檔案的程式。如果問題仍然存在，您可以嘗試重新啟動您的電腦，或檢查您的硬碟是否存在問題。 \n Q:那麼在Scite的輸出欄位中出現"pyw -u 文件"代表著甚麼意思? \n A:在 Scite 的輸出欄位中出現 "pyw -u 文件" 代表著正在執行一個 Python 程式，其中： \n "pyw" 是 Python 的執行檔案名稱，通常用於執行 GUI 應用程式。 "-u" 代表著執行 Python 程式時使用的參數，這裡 "-u" 是代表使用 unbuffered I/O（無緩衝輸入輸出）。 "文件" 是指正在執行的 Python 程式的檔案名稱。 因此，"pyw -u 文件" 意味著 Scite 正在使用 Python 執行檔案執行指定的 Python 程式檔案，並使用 unbuffered I/O 參數。 \n Q:那麼如果Scite執行了這個檔案中的代碼，並出現找不到指定檔案，你認為會是哪種問題? \n A:如果在 Scite 中執行 Python 程式時出現 "系統找不到指定的檔案" 的錯誤訊息，通常代表著程式中的某個檔案無法被找到，可能是以下原因之一： \n 1.路徑不正確：程式中指定的路徑可能是不正確的，例如路徑名稱有誤、縮寫或空格使用不當等。 2.檔案不存在：程式中指定的檔案可能不存在，例如該檔案被刪除或被移動到了其他地方。 3.權限不足：程式無法訪問該檔案，可能是因為權限不足或該檔案被鎖定而無法被訪問。 4.檔案正在被其他程式使用：可能是因為該檔案正在被其他程式使用而無法被訪問。 \n 如果程式中指定的檔案名稱和路徑都是正確的，可以檢查一下該檔案是否存在，並且您是否擁有足夠的權限來訪問該檔案。如果該檔案存在，請確保該檔案沒有被其他程式鎖定。另外，您也可以嘗試使用絕對路徑或相對路徑指定檔案的位置，以確保程式可以正確找到該檔案。 \n //到這裡，看來我白問了不少問題。 \n', 'tags': '', 'url': '0420-1hr.html'}, {'title': '0420-hr2', 'text': 'Q:我沒有移動檔案，單純只是在Scite的上輸入python代碼 print("hi") ，然後儲存在Scite的根目錄上，卻還是發生上述問題，該如何解決? \n A:如果您在 Scite 的根目錄中建立一個 Python 檔案，並在該檔案中加入 print("hi") 代碼，然後在 Scite 中運行該檔案時出現了 "系統找不到指定的檔案" 的錯誤，這可能是因為 Scite 沒有正確設置當前工作目錄。 \n 請確保您正在使用的 Scite 版本支援當前工作目錄設置，並且您已經正確地設置了當前工作目錄。您可以在 Scite 中通過點擊 "Options" 菜單中的 "Open User Options File" 來編輯 Scite 的用戶設置文件，然後添加以下行： \n cwd=$(FilePath) \n 這個設置將當前工作目錄設置為當前打開的檔案所在的目錄。這樣，當您運行 Python 程式時，Python 將會在當前工作目錄中搜索檔案，而不是在 Scite 的根目錄中搜索檔案，從而避免 "系統找不到指定的檔案" 的錯誤。 \n Q:我已經嘗試加入了以上代碼 目前我的環境如下(以基本目錄為Y硬碟): Y:\\wscite 為Scite目錄 Y:\\Python310 為python3.10.0目錄 而python代碼 print("hi") 儲存名稱為 test.py 並儲存在scite目錄下 但依舊出現同樣的問題，該如何解決? \n A:如果您已經在 Scite 的用戶設置文件中設置了當前工作目錄，但仍然出現 "系統找不到指定的檔案" 的錯誤，您可以試試以下解決方案： 1.確保 Python 已經安裝並設置好環境變數：請確保 Python 已經成功安裝在您的電腦上，並且已經設置好環境變數，以便您可以在命令提示符號或 Scite 中運行 Python 程式。 2.檢查 Scite 設置：請確保 Scite 的設置正確，例如編譯器路徑、Python 版本等。 3.檢查 Python 程式碼：請確保您的 Python 程式碼沒有錯誤，例如語法錯誤或拼寫錯誤等。 4.嘗試使用絕對路徑：請嘗試使用絕對路徑指定 Python 程式碼所在的位置，以確保 Scite 可以正確找到該檔案。例如，在 Scite 中使用以下代碼來執行您的 Python 程式碼： \n import os os.system("Y:/wscite/Python310/python.exe Y:/wscite/test.py") \n 這個代碼將 Python 程式碼 test.py 所在的絕對路徑傳遞給 Python 解釋器，從而避免了 "系統找不到指定的檔案" 的錯誤。 如果以上方法仍然無法解決問題，您可以嘗試重新安裝 Scite 和 Python，或者嘗試使用其他的程式碼編輯器來編輯和運行 Python 程式碼。 \n Q:我發現它輸入此程式碼後跳亂碼了...... \n A:如果您在 Scite 中輸入 Python 程式碼後出現亂碼，可能是因為 Scite 的編碼格式與您的 Python 程式碼的編碼格式不一致所導致的。 您可以嘗試以下方法解決問題： 設置 Scite 的編碼格式：打開 Scite，從菜單欄選擇「選項」 >「編輯器設置」 >「默認編碼」，選擇與您的 Python 程式碼相同的編碼格式。 轉換 Python 程式碼的編碼格式：使用一些編輯器工具（例如 Notepad++）將您的 Python 程式碼轉換為 Scite 使用的編碼格式，以確保 Scite 正確顯示您的程式碼。 在程式碼中添加編碼宣告：在 Python 程式碼的開頭添加一行編碼宣告，例如： \n # -*- coding: utf-8 -*- \n 這個宣告將告訴 Python 程式碼的解釋器使用 UTF-8 編碼格式來解讀程式碼。 希望以上方法能夠幫助您解決問題。 \n Q:在運行 import os os.system("Y:/wscite/Python310/python.exe Y:/wscite/test.py") 程式碼後，問題依舊是找不到指定的檔案 要不然試著一個個排除吧 \n 在那之後就是一大段的排除錯誤。 \n 當我進行到 A:如果在打開 Open User Options 後看到空白的介面，這代表你的 Scite 還沒有任何設置選項。你可以手動添加設置選項，方法如下： \n 創建一個空白的文本檔案。 將以下內容複製到文件中： \n #This is an example SciTE properties file with a couple of settings\n#that show how to configure SciTE to work with Python.\n#Define the location of the Python executable.\ncommand.go.*.py=python3 -u $(FileNameExt)\n#Enable the Python lexer.\nlexer.$(file.patterns.py)=python\n#Set the encoding for Python source code files.\ncode.page=65001 \n 將文件保存到 Scite 的配置文件夾中。你可以通過選擇「選項」>「打開配置文件夾」找到配置文件夾。在文件名輸入框中輸入「SciTEUser.properties」，然後點擊「保存」。 \n 重新啟動 Scite，你應該可以看到新添加的選項已經生效了。 注意：如果你的 Python 安裝路徑與預設路徑不同，你需要修改以上代碼中的 Python 執行路徑。 \n 接著，我的SciTE終於開始運作了！', 'tags': '', 'url': '0420-hr2.html'}, {'title': '0420-hr3', 'text': '', 'tags': '', 'url': '0420-hr3.html'}, {'title': '0420-hr4', 'text': '', 'tags': '', 'url': '0420-hr4.html'}]};